import React, { useState, useEffect } from 'react'; 
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom'; 
import '../../css/user/Usuarios.css';
import CustomNavbar from '../../components/CustomNavbar_01';

function Mapa() {
    const [datosMapa, setDatosMapa] = useState([]);
    const [selectedId, setSelectedId] = useState(null);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await fetch('http://localhost:8000/ubicacion');
                const data = await response.json();
                setDatosMapa(data);

            } catch (error) {
                console.error('Error al obtener los datos:', error);
            }
        };

        fetchData();
    }, []);


    const handleRowClick = (id_aviso) => {
        // Verificar si la fila clicada ya está seleccionada
        if (selectedId === id_aviso) {
            return; // Si ya está seleccionada, no hacemos nada
        } else {
            setSelectedId(id_aviso); // Si no está seleccionada, la seleccionamos
            console.log("ID del aviso seleccionado:", id_aviso); // Imprimir el ID del usuario seleccionado en la consola
        }
    };

    const handleDelete = () => {
        if (selectedId){
            const confirmDelete = window.confirm('¿Seguro que deseas eliminar esta ubicacion?');
            if (confirmDelete) {
                fetch(`http://localhost:8000/ubicacion/borrar/${selectedId}`, {
                    method: 'DELETE'
                })
                .then(response => {
                    if (!response.ok) {
                        throw new Error('Error al eliminar la ubicacion');
                    }
                    return response.json();
                })
                .then(data => {
                    // Actualizar la lista de pagina/mapa después de eliminar el usuario
                    const updatedMapa = datosMapa.filter(mapa => mapa.id !== selectedId);
                    setDatosMapa(updatedMapa);
                    // Limpiar la selección
                    setSelectedId(null);
                    window.location.href = '/pagina/mapa';
                })
                .catch(error => {
                    console.error('Error al eliminar la ubicacion:', error);
                });
            }
        } else {
            alert('Por favor, selecciona una ubicacion para eliminar.');
        }

    };




    return (
        <div className="app">
            <CustomNavbar />
            <div className="acontainer">
                <div className="container d-flex justify-content-between align-items-center">
                    <h1 className="fs-1"><b>Mapa</b></h1>
                    <div className="d-flex align-items-center">


                    </div>
                </div>
            </div>
            <div id="tabla-container" class="px-4 py-4">
                <table className="table table-hover" style={{ backgroundColor: "transparent", borderCollapse: "separate", borderSpacing: "0 8px" }}>
                    <thead>
                        <tr style={{ borderBottom: "2px solid #04703F" }}>
                            <th scope="col" className="fs-3" style={{ backgroundColor: "#FDFBF6", borderBottom: "none", color: "#04703F" }}>Lugar</th>
                            <th scope="col" className="fs-3" style={{ backgroundColor: "#FDFBF6", borderBottom: "none", color: "#04703F" }}>Latitud</th>
                            <th scope="col" className="fs-3" style={{ backgroundColor: "#FDFBF6", borderBottom: "none", color: "#04703F" }}>Longitud</th>

                        </tr>
                    </thead>
                    <tbody>
                        {datosMapa.map((aviso) => (
                        <tr
                            key={aviso.id}
                            onClick={() => handleRowClick(aviso.id)}
                            className={selectedId === aviso.id ? 'selected' : ''}
                            style={{ borderBottom: "2px solid #000", cursor: "pointer" }}
                        >
                            <td className='fs-4' style={{ borderBottom: "2px solid #04703F", color: "#04703F"}}>{aviso.lugar}</td>
                            <td className='fs-4' style={{ borderBottom: "2px solid #04703F", color: "#04703F"}}>{aviso.latitud}</td>
                            <td className='fs-4' style={{ borderBottom: "2px solid #04703F", color: "#04703F"}}>{aviso.logitud}</td>
                        </tr>
                    ))}

                    </tbody>
                </table>
            </div>

        </div>
    );
}

export default Mapa;
